  En relación a su pedido código /*codigo*/ queremos solicitarle que confirme los datos volcados en su pedido. El problema presentado en relación al mismo se describe a continuación:

/*problema*/

  Recuerde por favor acceder al sitio /*sitio*/ en la opción Sitio de Usuarios y allí buscar en la opción Pedidos para confirmar. 

')##INSERT INTO Plantmail (Id,Denominacion,Cuando_Usa,Texto) VALUES ('3','Confirmación de Pedido','4','Estimado /*usuario*/:
 
  Tenemos el agrado de dirgirnos a usted con la finalidad de solicitarle tenga a bien confirmar los datos cargados en el pedido /*pedido*/, el cual no ha podido ser hallado en las respectivas consultas a Bases de Datos que hemos realizado. 

Sin mas, lo saluda atentamente.

Personal de Búsqueda en BDD 
ISTEC-PrEBi On-Line
UNLP')##INSERT INTO Plantmail (Id,Denominacion,Cuando_Usa,Texto) VALUES ('4','Recepción de Pedido','6','Estimado Usuario /*usuario*/:

  Tenemos el agrado de dirigirnos a usted con la finalidad de avisarle que su pedido con descripción:  

/*pedido*/

 /*cita*/

ha sido recibido. El mismo puede ser retirado en las oficinas del PrEBi en el horario de 13 a 18.00 hs.

  Sin más, lo saluda atentamente,

Personal ISTEC-PreBi')##INSERT INTO Plantmail (Id,Denominacion,Cuando_Usa,Texto) VALUES ('5','Lista Correo - Pedidos sin retirar','2','Estimado/a /*usuario*/:

  Nos dirigimos a Usted dado que se registra en nuestra Base de Datos que posee /*numero_pedidos*/ pedido(s) solicitado(s) sin retirar de nuestras oficinas.

  Le rogamos efectuar tal diligencia los días hábiles en el horario de 13 a 17 hs. Sin mas los saluda Atentamente.

Marisa R.De Giusti
Directora PrEBi
UNLP
')##INSERT INTO Plantmail (Id,Denominacion,Cuando_Usa,Texto) VALUES ('6','Bienvenido al PrEBi!!!','100','Estimado /*usuario*/:

Por la presente cumplo en informarle que ha sido dado de alta como Usuario del Proyecto de Enlace de Bibliotecas. A partir de este momento podrá realizar sus solicitudes de "Búsqueda"
del material bibliográfico que Usted necesite, directamente a través de nuestra página web:
http://www.unlp.istec.org/prebi/

Ingrese al Sitio de Usuario cliqueando  este item en la parte superior de la pantalla de su explorador, despues de hacerlo deberá completar la siguiente información:

  Su login es: /*login*/
  Su clave es: /*password*/

A partir de este momento se encuentra en su "sitio personal"  del PrEBi.

Por favor cambie su password a posteriori de ingresar  al sitio para respetar las normativas de seguridad del mismo. Para  cambiar su clave seleccione Cambiar Clave de acceso y modifique los datos, según su comodidad.

Entre las ventajas de este sistema podemos mencionar que el usuario cuenta con la  información en tiempo real de todo lo que ocurrre con sus solicitudes en curso y un registro histórico relacionado con todas sus solicitudes a lo largo del tiempo de utilización del servicio.                                      
Por medio de la Opción Pedido Nuevo, usted puede llenar el formulario para solicitar un Pedido Nuevo sin necesidad de escribirnos un email. Esta modalidad acelera el proceso de búsqueda.

Para retirar los pedidos personalmente, nuestra direccion es Calle 49 y 115 (frente al viejo departamento de Fisica)  el edificio construído para que funcionara  el Liceo y en el que  finalmente funcionan aulas y secretarias de Informatica e Ingenieria. 
Nuestro lugar de trabajo es en el primer piso pasando la Secretaria de Fisicomatematica
de la Facultad de Ingenieria.

  Afectuosamente.
  
  Marisa De Giusti
  Directora PrEBi.')##INSERT INTO Plantmail (Id,Denominacion,Cuando_Usa,Texto) VALUES ('7','Rechazo de Alta','101','Estimado /*usuario*/:

  Lamentamos informarle que no es posible darle de alta en el servicio de acceso al software PrEBi On-Line. La dificultad que impide su acceso consiste en:

  Su solicitud lamentablemente ha sido dada de baja, por lo que en caso de interesarle ingresar al servicio debera agregarla de nuevo.

Muchas Gracias por su interés en nuestros servicios.


  ')##INSERT INTO Plantmail (Id,Denominacion,Cuando_Usa,Texto) VALUES ('8','no es de UNLP','101','Estimado docente/investigador:

Lamentablemente no podemos en este momento darle el alta para el servicio de obtención de material bibliográfico de la Universidad Nacional de La Plata puesto que los costos del mismo son asumidos por esta misma. 
Siempre está en evaluación la posibilidad de ofrecer este servicio a distintas Universidades de país de alguna manera. En caso de tener Usted interés a nivel Institucional o especial interés personal por la obtención de documentos, puede contactarse con la Ing. Marisa De Giusti (marisadg@volta.ing.unlp.edu.ar), Directora del Proyecto quien pondrá a consideración su acceso al servicio.
Estamos muy agradecidos por el interés que ha demostrado.

Atte.

Personal del PrEBi
UNLP
')##INSERT INTO Plantmail (Id,Denominacion,Cuando_Usa,Texto) VALUES ('9','Cancelación de solicitud de bibliografía','8','Estimado Usuario /*usuario*/:

  Me dirijo a ud. para informarle que lamentablemente no hemos ubicado su solicitud de:

 /*cita*/

Lo sentimos mucho.
Hasta pronto.


Personal ISTEC-PreBi')##INSERT INTO Plantmail (Id,Denominacion,Cuando_Usa,Texto) VALUES ('10','Reconfirmacion de los pedidos encontrados','2','Estimado/a NOMBRE:

