Aguardamos tu respuesta

Gustavo
Personal del PREBI 

')##INSERT INTO Plantmail (Id,Denominacion,Cuando_Usa,Texto) VALUES ('12','Reconfirmacion de los pedidos encontrados f.','2','Estimado/a NOMBRE Y APELLIDO,

  Nos dirigimos a Usted dado que se registra en nuestra Base de Datos que posee /*numero_pedidos*/ pedido(s) solicitado(s) sin retirar de nuestras oficinas.

  Le rogamos efectuar tal diligencia los días hábiles en el horario de 13 a 18 hs. Sin embargo, si usted lo desea, le ofrecemos acercar los pedidos personalmente. En caso de que así lo desee, informenos por medio de un mail. Sin más se despide

Atte.

Gustavo
Personal del PREBI
')##INSERT INTO Plantmail (Id,Denominacion,Cuando_Usa,Texto) VALUES ('13','Servicio especial','4','Estimado NOMBRE,

Se le comunica que el pedido que usted nos solicitó, está disponible vía SECyT. Si a pesar de ésto, usted aún desea nuestros servicios, le rogamos nos confirme la solicitud.

Atte.

Personal del PREBI')##INSERT INTO Plantmail (Id,Denominacion,Cuando_Usa,Texto) VALUES ('15','Articulo disponible en SeCyT','11','Estimado /*usuario*/

Por medio de la presente le informamos que el material por usted solicitado se encuentra disponible gratuitamente en la base de datos provista por SeCyT bajo el link
<LINK>
Usted puede bajarse el material correspondiende desde dicha dirección, y si encuentra dificultades para adquirir el material puede solicitarle al personal de PrEBi que lo bajen por usted.')##INSERT INTO Plantmail (Id,Denominacion,Cuando_Usa,Texto) VALUES ('16','Documento listo para descargar','12','Estimado /*usuario*/

Le informo a Ud. que su solicitud /*pedido*/

/*cita*/ 
ha sido recibido.

Usted puede encontratrlo en su SITIO DE USUARIOS en la página web del PrEBi  http://www.unlp.istec.org/prebi/

Recuerde que puede bajar el artículo sólo UNA vez.

Si tiene inconvenientes por favor contáctenos a bibistec@ing.unlp.edu.ar

Atte.

Personal del PrEBi')##INSERT INTO Secciones (Id,Orden,Nombre,Codigo_Idioma,Ultima_Actualizacion,Visitas) VALUES ('7','1','ISTEC do Argentina prebi','2','0000-00-00','9')##INSERT INTO Secciones (Id,Orden,Nombre,Codigo_Idioma,Ultima_Actualizacion,Visitas) VALUES ('2','2','Información ISTEC en Argentina','1','2002-11-14','530')##INSERT INTO Secciones (Id,Orden,Nombre,Codigo_Idioma,Ultima_Actualizacion,Visitas) VALUES ('8','1','Información General acerca del Pr.E.Bi.','1','2004-08-30','758')##INSERT INTO Secciones (Id,Orden,Nombre,Codigo_Idioma,Ultima_Actualizacion,Visitas) VALUES ('6','6','Proyecto de desarrollo aporte ISTEC','1','0000-00-00','371')##INSERT INTO Secciones (Id,Orden,Nombre,Codigo_Idioma,Ultima_Actualizacion,Visitas) VALUES ('9','5','Download de documentos','1','2002-05-23','607')##INSERT INTO Sugerencias (Id,Titulo,Comentario) VALUES ('1','De qué modo puede ayudarnos el Usuario para agilizar las búsquedas?','Resulta de gran importancia que el
Usuario nos envíe TODOS los datos
con los que cuenta relativos a su solicitud. El tiempo invertido en adicionar autores, títulos de artículos, etc., redunda en beneficio ya que acelera la localización.')##INSERT INTO Sugerencias (Id,Titulo,Comentario) VALUES ('2','Cuando debo registrar un pedido?','Cuando se han agotado las posibilidades de búsqueda en las bibliotecas de la UNLP. Nuestro personal se haya capacitado para encontrar su solicitud en las Bibliotecas cooperantes en ISTEC.')##INSERT INTO Sugerencias (Id,Titulo,Comentario) VALUES ('3','Utilización del Sitio para realizar sus pedidos y chequear el estado de los mismos','Estimados Usuarios, les recordamos y sugerimos comenzar a utilizar el sitio del PrEBi para la realización de sus solicitudes. Cada Usuario tiene su Login y password y dispone de esta facilidad que también sirve para agilizar el servicio.')##INSERT INTO Sugerencias (Id,Titulo,Comentario) VALUES ('4','Solicitudes Vía WEB','Estimados Usuarios: hemos detectado que en muchas ocasiones al ingresar un pedido lo hacen eligiendo PROVISION, la elección de PROVISION alude a nuestro servicio hacia el exterior, esto es cuando una Biblioteca del exterior solicita material de la UNLP; toda vez que un Usuario de la UNLP ingrese un pedido debe seleccionar BUSQUEDA, en ningún caso PROVISION. Les agradecemos su ayuda, atentamente. 
Marisa De Giusti
