ro de pedidos que se atienden mes a mes en el PreBi tanto como analizar hacia donde se re orientan las solicitudes. Cuales bibliotecas del exterior atienden y en que proporción cada una.','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-001','fec-1','2','Fecha de Inicio del Pedido','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-001','com-4','2','En las estadísticas del material bibliográfico podrá apreciar análisis sobre el material bibliográfico solicitado: Que colecciones son las mas solicitadas - número de activas - año que pertenece el material solicitado y toda información del material','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-002','ayu-1','2','Usando esta estadística podrá ver el número de pedidos que se realizaron al PrEBi durante uno o mas años por mes. Tambien podrá diferenciar entre pedidos recibidos - cancelados o los iniciados independientemente de su resultado','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-001','com-3','2','En las estadísticas orientadas a Usuarios podrá determinar cual es el perfil de los usuarios que solicitan documentos:Que actividad principal desarrollan - que instituciones y laboratorios solicitan y sus proporciones','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-001','com-2','2','En las estadísticas orientadas a demoras podrá analizar cuanto tardan los pedidos en ser recibidos. Tambien tardanza promedio de bibliotecas del exterior en retornar el documento solicitado. De igual forma se presentará toda información relativa a las dem','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-001','h-4','2','Material Bibliográfico','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-002','ayu-11','2','El presente informe presenta la tardanza clasificada de 1 a 10 o mas días por País destino','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-001','h-3','2','Estadísticas de Usuarios','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-001','h-2','2','Demoras de Pedidos','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-002','ayu-10','2','Esta estadística presenta un informe de tardanza clasificada hasta la recepción del pedido. La clasificación se efectúa de 1 a 10 o mas días de espera. La presente estadística muestra globalmente la espera para todos los pedidos del PrEBi','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-002','ayu-13','2','En este informe se presenta la tardanza clasificada por Biblioteca a la que se le solicita el pedido','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-002','ayu-12','2','Aquí se presenta al igual que las anteriores: La tardanza clasificada por Institución a la que se le solicitó el pedido','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-001','fec-2','2','Fecha de Recepción','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-002','ayu-16','2','Aquí podrá revisar el número de pedidos originados de acuerdo al país de orígen de los usuarios solicitantes','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-002','ayu-17','2','Igual que la estadística anterior pero se discrimina el orígen por Institución dentro del país','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-001','h-1','2','Pedidos en Cantidades','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-002','ayu-15','2','Esta estadística presenta la cantidad de usuarios nuevos mes a mes incorporados al sistema. Se cuentan los usuarios agregados por pedido directo - los usuarios de perfil bibliotecario y los usuarios agregados por los bibliotecarios','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-002','ayu-18','2','Estadística que presenta el número de pedidos discriminado por la dependencia o Facultad dentro de un país y una Institución. Es posible asimismo discriminar por mes o año','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-002','ayu-28','2','Revisando esta estadística podrá analizar los títulos mas solicitados por los investigadores al PrEBi por año. Solo se incluyen los títulos de revistas que ya han finalizado su ciclo administrativo (Históricos)','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-002','ayu-19','2','Igual que los informes anteriores pero discriminado por la división dentro de la dependencia. Dichas divisiones pueden referirse a Laboratorios o Unidades de Investigación dentro de Facultades','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-002','ayu-22','2','Aquí presentaremos el número de pedidos de provisión atendidos de acuerdo a la función del usuario solicitante','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-002','ayu-2','2','Usando esta estadística podrá ver las cantidades de los diferentes tipos de pedidos que recibe el PrEBi: Artículos de Revistas - Partes de Libros - Patentes - Actas de Congresos y Tesis tambien discriminados por año y mes.','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-002','ayu-25','2','Aquí presentaremos de igual forma que los usuarios activos con el sistema - el número de títulos de revistas activos mes a mes o totalizados por año','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-002','ayu-14','2','Aqui se presenta la cantidad de días en promedio que tarda un país de los integrantes del sistema en devolver el pedido realizado. Si usa la opción de Discriminar por año vera ademas la cantidad de pedidos realizados a ese país','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-002','ayu-24','2','Esta estadística presenta el número de pedidos clasificado por la década del material. Es decir que si el material tiene fecha de publicación en 1972 por ejemplo aparecerá contado en la década de 1970-1980. Esta información puede obtenerse por año o mes','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-002','ayu-21','2','Aqui podemos apreciar el número de pedidos realizados por cada tipo de usuario de acuerdo a su función ppal: Docencia - investigación - etc.','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-002','ayu-20','2','Esta estadística presenta el número de usuarios del total que posee registrado el PrEBi que activamente solicitan documentos. Por mes se considera que entre distintos meses los usuarios pueden repetirse. Si se ve el informe acumulado son usuarios di','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-002','ayu-27','2','Como en la estadística anterior presentaremos el número de colecciones activas solicitadas','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-002','ayu-26','2','Esta estadística presenta el número de pedidos provistos clasificado por la década del material. Esta información puede obtenerse por año o mes','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-002','ayu-29','2','Revisando esta estadística podrá analizar los títulos mas provistos por el PrEBi a las dependencias que solicitan provisión de documentos. Incluidos solo aquellos títulos históricos','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-002','ayu-3','2','Los pedidos que se realizan al PrEBi se redirigen a Bibliotecas del exterior. Usando esta estadística podrá ver hacia que países se redirigen los pedidos','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-002','ayu-5','2','Aquí se presentarán las bibliotecas dentro de las instituciones que atienden los pedidos del PrEBi.','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-002','ayu-6','2','Este indicador de la actividad del PrEBi muestra mes a mes por año la cantidad de páginas impresas y entregadas a los investigadores que solicitan.','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-002','ayu-4','2','Al igual que la estadística anterior podrá revisar dentro de los países a los que se redirigen los pedidos y las Instituciones que los atienden.','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-002','ayu-7','2','Estas estadísticas son referidas a los pedidos que otras instituciones del exterior realizan al PrEBi. Revisando la misma podrá ver que número de pedidos de documentos existentes en Argentina se reciben.','')##IN