dioma,Texto,Nombre_Archivo) VALUES ('bib-001','et-2','1','A continuación encontrará un listado de direcciones web que se corresponden con las ubicaciones en Internet de los catálogos de las bibliotecas cooperantes con el servicio PrEBi desde el exterior. La razón de mostrarle estos catálogos radica en que usted pueda realizar si asi lo desea la búsqueda de su cita bibliográfica y la localización de la misma. De este modo, también conocerá más exhaustivamente nuestro trabajo. Usted puede proveernos la informacion que ha obtenido de su búsqueda a través del campo de la solicitud denominado biblioteca sugerida.
Más allá de ayudarnos en nuestro trabajo, esta nueva opcion tiende a generar usuarios capacitados, una tendencia que es observable en Bibliotecas de Universidades muy avanzadas. Naturalmente comprendemos que si usted realiza las búsquedas surgirán preguntas referidas a las mismas. Como parte de esta capacitación, usted puede consultar online al PrEBi para que lo ayuden a ayudarnos. El mecanismo de solicitud continuará siendo el mismo que usted utiliza hasta el momento con la única inclusión antes mencionada de la biblioteca sugerida en el caso de haber realizado exitosamente la búsqueda; si usted no localiza su material envie igual la solicitud, debido a que el personal de PrEBi puede instanciar otros posibles lugares de obtención de su materia.','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('bib-001','et-3','1','Institución','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('bib-001','bot-1','1','Enviar','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('bib-001','et-4','1','Buscar','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('adm-004','bot-1','1','Enviar','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('adm-004','bot-2','1','Revisar Pedido','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('adm-004','bot-3','1','Generar Evento','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('adm-004','et-1','1','Tipo de Pedido','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('adm-004','et-2','1','Id:','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('adm-004',