to,Nombre_Archivo) VALUES ('est-001','txt-2','1','En las estad&iacute;sticas orientadas a cantidades podr&aacute;  ver el n&uacute;mero de pedidos que se atienden mes a mes en el PreBi tanto como analizar hacia donde se re orientan las solicitudes, cuales bibliotecas del exterior atienden y en que proporci&oacute;n cada una.','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-001','txt-2','3','In the Amounts Oriented Statistics section you will see the amount of orders taken month by month in PrEBi, and you will be able to analize where request are oriented to, which foreign libraries attend requests and which proportion each one','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-001','txt-3','1','Pedidos de B&uacute;squeda de Documento.','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-001','txt-3','3','Document Search Requests.','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-001','txt-4','1','N&uacute;mero de Pedidos por mes y a&ntilde;o.','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-001','txt-4','3','Number of requests by month and by year','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-001','txt-5','1',' Usando esta estad&iacute;stica podr&aacute;  ver el n&uacute;mero de pedidos que se realizaron al PrEBi durante uno o mas a&ntilde;os, discriminado por mes. Tambien podr&aacute;  diferenciar entre pedidos recibidos - cancelados o los iniciados independientemente de su resultado','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-001','txt-5','3','Using this statistic you will see the number of requests made to PrEBi during one or more years, discriminated monthly. You will be also able to diferenciate among received, cancelled or started requests independently of the result','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-001','txt-6','1','Distribuci&oacute;n del Destino de las Solicitudes - Pa&iacute;s','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-001','txt-6','3','Requests destiny distribution - Countries','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-001','txt-7','1','Los pedidos que se realizan al PrEBi se redirigen a Bibliotecas del exterior. Usando esta estad&iacute;stica podr&aacute;  ver hacia que pa&iacute; ses se redirigen los pedidos','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-001','txt-7','3','Requests made to PrEBi go to libraries abroad. Using this statistic you will be able to see which country requests go to','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-001','txt-8','1','Distribuci&oacute;n del Destino - Instituciones.','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-001','txt-8','3','Requests destiny distribution - Institutions','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-001','txt-9','1','Al igual que la estad&iacute;stica anterior podr&aacute;  revisar dentro de los pa&iacute;ses a los que se redirigen los pedidos y las Instituciones que los atienden.','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('est-001','txt-9','3','Like the statistics by country, you will be able to check, for each country where requests go to, Institutions that serve those request