o) VALUES ('dds-001','st-003','1','IBERO AMERICAN SCIENCE EDUCATION CONSORTIUM (ISTEC)','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('dds-001','st-003','3','IBERO AMERICAN SCIENCE EDUCATION CONSORTIUM (ISTEC)','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('dds-001','st-004','1','Consorcio Iberoamericano para Educación en Ciencia y Tecnología','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('dds-001','st-005','1','Usted encontrará aquí una muy breve exposición relativa a ISTEC, por favor,
                               visite el sitio <a href=http://www.istec.org target=_BLANK> www.istec.org </a>  para conocer en profundidad los
                               proyectos del Consorcio y lo que el Consorcio puede hacer por Usted.','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('dds-001','st-006','1','¿Qué es el ISTEC?','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('dds-001','st-007','1','Es una organización sin fines de lucro compuesta por Instituciones educativas,
                              de investigación, miembros industriales y  honorarios de América y España.','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('dds-001','st-008','1','¿Cuáles son sus objetivos?','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('dds-001','st-009','1','El Consorcio fue concebido para mejorar la calidad de la educación, generar
                              programas de investigación y desarrollo, proveer mecanismos efectivos para la
                              transferencia de tecnología y promover la cooperación internacional en ciencia
                              y tecnología.','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('dds-001','st-010','1','¿Qué proyectos sustenta ISTEC?','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('dds-001','st-011','1','ISTEC tiene cuatro proyectos principales:','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('dds-001','st-012','1','DLL: Dedicado a enlazar bibliotecas en distintos países para compartir acervos bibliográficos','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('dds-001','st-013','1','ACE: Dedicado a la Educación Continua para propender al desarrollo.','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('dds-001','st-014','1','R&D: Dedicado a la investigación de nuevas tecnologías y al desarrollo de laboratorios.','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('dds-001','st-015','1','Los Libertadores: Dedicado a ayudar en el diseño de Centros de Excelencia, a medida en las Universidades que así lo requieran.','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('dds-001','st-016','1','¿Quiénes son sus miembros?','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('dds-001','st-017','1','Los siguientes países cuentan con Universidades miembros de ISTEC:','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('dds-001','p-1','1','<table>
