a gestión de solicitudes, a su facilidad de uso tanto para la administración como los usuarios, y a que ofrece a cualquier visitante un importante número de estadísticas en tiempo real, que transparentan nuestro trabajo.Esperamos que este servicio satisfaga sus expectativas y agradeceremos dudas y sugerencias que nos ayuden a mejorar. ¡Estamos para servirle!.','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('ini_002','st-002','3','This site is supported by CELSIUS Software, version 1.5, completely developped and mantained by PrEBi staff. We are glad to inform that it has been installed in many libraries in United States, Brazil, Venezuela, Colombia, Ecuador, Panama, due to fully capacity it offers in requests management, easyly use either for Users and Administrators, and the variety of statistics for any visitor, showing to everybody our work. We expect this service to satisfies your expectations, and we accept any doubt or suggestion that helps us to make a better work. We are here to serve you!.','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('ini_002','st-001','1','Noticias','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('ini_002','st-001','2','Noticias','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('ini_002','st-001','3','News','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('ini_001','st-006','1','Login Usuario / Registrarse','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('ini_001','st-006','2','Login Usuario / Registrarse','')##INSERT INTO Traducciones (Codigo_Pantalla,Codigo_Elemento,Codigo_Idioma,Texto,Nombre_Archivo) VALUES ('ini_001','st-006','3','User Login','')##INSERT INTO Traducciones (Codigo_Pantal